  <View style={{ flexDirection:"column" }}>
    <View style={styles.buttonStyle}>
        <Button>Button 1</Button>
    </View>
    <View style={styles.buttonStyle}>
        <Button>Button 2</Button>
    </View>
</View>
)

const styles = StyleSheet.create({
buttonStyle: {

  position: 'absolute',
  left: 0,
  top: 0,
  border: '5px solid green',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center'
}
});

export default App;
